                    'name' => 'Koderspedia',
                    'email' => 'info@koderspedia.com',
                    'address' => '228 Hamilton, Fl 3 Palo Alto, CA 94301 UNITED STATES',
                    'logoName' => 'koderspedia.png',
                    'logo' => '',
                    'logoMiniName' => 'koderspedia_mini.png',
                    'logo_mini' => "",
                ],
                
                [
                    'name' => 'Webflowcreators',
                    'email' => 'connect@webflowcreators.com',
                    'address' => '228 Hamilton, Fl 3 Palo Alto, CA 94301 UNITED STATES',
                    'logoName' => 'shopifywebcreators.png',
                    'logo' => '',
                    'logoMiniName' => 'shopifywebcreators_mini.png',
                    'logo_mini' => "iVBORw0KGgoAAAANSUhEUgAAAP4AAAEgCAYAAACU1c66AAAACXBIWXMAACE4AAAhOAFFljFgAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAALgKSURBVHgB7f3nliRXlh4K7nNMm8vQkRIqIQqlC",

                ],
                [
                    'name' => 'Shopifywebcreators',
                    'email' => 'connect@shopifywebcreators.com',
                    'address' => '228 Hamilton, Fl 3 Palo Alto, CA 94301 UNITED STATES',
                    'logoName' => 'webflowcreators.png',
                    'logo' => '',
                    'logoMiniName' => 'webflowcreators_mini.png',
                    'logo_mini' => "",

                ],
            ];

        foreach ($brands as $brand) {
            $authController = new AuthController();
            if ($brand['logo'] && $brand['logo_mini']) {
                $logoFile = $authController->base64ToFile($brand['logo']);
                if (!$logoFile) {
                    throw new Exception('Invalid base64 string');
                }
                $logoFile->move('public/images/brands', $brand['logoName']);

                $logoMiniFile = $authController->base64ToFile($brand['logo_mini']);
                if (!$logoMiniFile) {
                    throw new Exception('Invalid base64 string');
                }
                $logoMiniFile->move('public/images/brands', $brand['logoMiniName']);
            }
            Brand::updateOrCreate(
                ['name' => $brand['name']],
                [
                    'email' => $brand['email'],
                    'address' => $brand['address'],
                    'logo' => $brand['logoName'],
                    'logo_mini' => $brand['logoMiniName']
                ]
            );
        }
    }
}
